    if (isLoading) {
      return <div>Loading...</div>; // Show loading message
    } else if (stockDataKeys.length > 0) {
      const lastElement = stockDataKeys[stockDataKeys.length - 1];
      const percentage =
        ((stockData[lastElement]["4. close"] - stockData[lastElement]["1. open"]) / stockData[lastElement]["1. open"])*100;

      return (
        <div>
          <p>Percentage: {percentage}</p>
        </div>
      );
    } else {
      return <div>No data available.</div>;
    }


}

export default App;
